import React from 'react';
import './Button.css'
import { Container, Row, Col, Card } from 'react-bootstrap';

const Button = ({num}) => {
  return (
    <Container>
      <Row className="justify-content-center">
        <Col xs={8} lg={6} className="mt-4" style={{height: '15rem', width: '15rem'}}>
          <Row className="rounded-circle bigButton">

          </Row>
          {num}
        </Col>
      </Row>
    </Container>
  );
}

export default Button;
